    right_text = [{'Fisheryyy Management': '<ul>\n<li><a href="http://www.greateratlantic.fisheries.noaa.gov/index.html">NOAA Fisheries</a>, the <a href="http://www.mafmc.org/">Mid-Atlantic Fishery Management Council</a>, and the <a href="http://asmfc.org/" rel="external">Atlantic States Marine Fisheries Commission</a> manage the bluefish fishery.</li>\n<li>Managed under the <a href="http://www.mafmc.org/fisheries/fmp/bluefish">Bluefish Fishery Management Plan</a>:\n<ul>\n<li>Commercial fishermen must have a permit to catch and sell bluefish.</li>\n<li>Managers set an annual catch limit.</li>\n<li>The majority of catch is allocated to the recreational fisheries.</li>\n<li>The commercial catch limit is divided into state-specific allocations. Unused recreational catch can be re-allocated to commercial fisheries.</li>\n</ul>\n</li>\n</ul>\n', 'Habitat': '<ul>\n<li>Bluefish live in temperate and tropical coastal oceans around the world, except in the eastern Pacific.</li>\n<li>They gather by size in schools that can cover tens of square miles of ocean, equivalent to 10,000 football fields.</li>\n<li>Bluefish migrate seasonally, moving north in spring and summer as water temperatures rise and then south in autumn and winter to waters in the South Atlantic Bight.</li>\n<li>Females release their eggs in the open ocean.</li>\n<li>Larvae develop into juveniles near the surface in continental shelf waters and eventually move to estuarine and nearshore shelf habitats.</li>\n<li>Juveniles prefer sandy ocean bottoms but will also inhabit mud, silt, or clay ocean bottoms or vegetated areas.</li>\n<li>Adults live in both inshore and offshore areas and favor warmer water.</li>\n</ul>\n', 'Habitat Impacts': 'Recreational fishermen use hook-and-line gear that has minimal impacts on habitat. Commercial fishermen use a variety of gears including trawls, gillnets, haul seines, and pound nets, and the impacts vary by gear type.', 'Image Gallery': [{'src': 'https://origin-east-01-drupal-fishwatch.woc.noaa.gov/sites/default/files/01_10.jpg', 'alt': 'Bluefish have a prominent jaw, with sharp, compressed teeth.', 'title': 'Bluefish have a prominent jaw, with sharp, compressed teeth.'}, {'src': 'https://origin-east-01-drupal-fishwatch.woc.noaa.gov/sites/default/files/02_8.jpg', 'alt': 'A recreational fisherman with his catch of bluefish. Bluefish are one of the most popular recreational species along the Atlantic coast.', 'title': 'A recreational fisherman with his catch of bluefish. Bluefish are one of the most popular recreational species along the Atlantic coast.'}, {'src': 'https://origin-east-01-drupal-fishwatch.woc.noaa.gov/sites/default/files/03_6.jpg', 'alt': 'A historic photo of a crew of New York bluefish fisherman.', 'title': 'A historic photo of a crew of New York bluefish fisherman.'}, {'src': 'https://origin-east-01-drupal-fishwatch.woc.noaa.gov/sites/default/files/05_7.jpg', 'alt': 'Filleting freshly-caught bluefish.', 'title': 'Filleting freshly-caught bluefish.'}, {'src': 'https://origin-east-01-drupal-fishwatch.woc.noaa.gov/sites/default/files/06_3.jpg', 'alt': 'Bluefish in the pan.', 'title': 'Bluefish in the pan.'}], 'Location': '<ul>\n<li>Along the East Coast from Maine to eastern Florida.</li>\n</ul>\n', 'Management': None, 'NOAA Fisheries Region': 'Greater Atlantic', 'Population': 'Significantly below target population level. A rebuilding plan is in place.', 'Population Status': '<ul>\n<li>According to the 2021 stock assessment, bluefish is overfished and not subject to overfishing. Summary stock assessment information can be found on <a href="https://www.st.nmfs.noaa.gov/stocksmart?stockname=Bluefish%20-%20Atlantic%20Coast&amp;stockid=10388">Stock SMART</a>.</li>\n</ul>\n', 'Scientific Name': 'Pomatomus saltatrix', 'Species Aliases': '<a href="/species-aliases/tailor" typeof="skos:Concept" property="rdfs:label skos:prefLabel" datatype="">Tailor</a>, <a href="/species-aliases/snapper" typeof="skos:Concept" property="rdfs:label skos:prefLabel" datatype="">Snapper</a>, <a href="/species-aliases/baby-blues" typeof="skos:Concept" property="rdfs:label skos:prefLabel" datatype="">Baby blues</a>, <a href="/species-aliases/choppers" typeof="skos:Concept" property="rdfs:label skos:prefLabel" datatype="">Choppers</a>, <a href="/species-aliases/elfs" typeof="skos:Concept" property="rdfs:label skos:prefLabel" datatype="">Elfs</a>', 'Species Illustration Photo': {'src': 'https://origin-east-01-drupal-fishwatch.woc.noaa.gov/sites/default/files/bluefish.png', 'alt': 'Bluefish', 'title': 'Bluefish'}, 'Species Name': 'Bluefish', 'Animal Health': None, 'Availability': '<p>Fresh year-round, but varies by area. Not available frozen. Buy in season, and plan to cook within a day of purchase.</p>\n', 'Biology': '<ul>\n<li>Bluefish live up to 12&nbsp;years.</li>\n<li>They grow fast, up to 31 pounds and 39 inches.</li>\n<li>They are able to reproduce at age 2, when they’re 15 to 20 inches in length.</li>\n<li>Depending on their size, females can have between 400,000 and 2 million eggs.</li>\n<li>Bluefish spawn multiple times in spring and summer.</li>\n<li>They exhibit feeding behavior called the “bluefish blitz,” where large schools of big fish attack bait fish near the surface, churning the water like a washing machine. They feed voraciously on their prey, eating almost anything they can catch and swallow.</li>\n<li>Bluefish have razor-sharp teeth and shearing jaws that allow them to ingest large parts, increasing the maximum size of the prey they can eat.</li>\n<li>They eat squid and fish, particularly menhaden and smaller fish such as silversides.</li>\n<li>Sharks, tunas, and billfishes are typically the only fish predators large and fast enough to prey on adult bluefish.</li>\n<li>Bluefish make up a major part of the diet of <a href="https://www.fishwatch.gov/profiles/atlantic-shortfin-mako-shark">shortfin mako sharks</a>&nbsp;and are also very important in the diets of <a href="https://www.fishwatch.gov/profiles/north-atlantic-swordfish">swordfish</a>.</li>\n<li>Oceanic birds prey on juvenile bluefish.</li>\n</ul>\n', 'Bycatch': 'Regulations are in place to minimize bycatch.', 'Calories': '124', 'Carbohydrate': '0 g', 'Cholesterol': '59 mg', 'Color': '<p>The meat of raw bluefish is light putty to blue-gray in color with a brownish tinge. It becomes lighter when cooked.</p>\n', 'Disease Treatment and Prevention': None, 'Diseases in Salmon': None, 'Displayed Seafood Profile Illustration': None, 'Ecosystem Services': None, 'Environmental Considerations': None, 'Environmental Effects': None, 'Farming Methods': None, 'Farming Methods_': None, 'Fat, Total': '4.24 g', 'Feeds_': None, 'Feeds': None, 'Fiber, Total Dietary': '0 g', 'Fishing Rate': 'At recommended level.', 'Harvest': '<ul>\n<li>In 2021, commercial landings of bluefish totaled more than 2.4 million pounds and were valued at $2.2 million, according to the NOAA Fisheries <a href="https://www.fisheries.noaa.gov/foss/f?p=215:200:3577333744020::NO:::">commercial fishing landings database</a>.</li>\n<li>In 2021, recreational anglers landed 12.8&nbsp;million pounds of bluefish, according to the NOAA Fisheries<a href="https://www.fisheries.noaa.gov/foss/f?p=215:200:3577333744020::NO:::"> recreational fishing landings database</a>.</li>\n<li>Florida, North Carolina, and New Jersey account for the largest percentage of the recreational bluefish harvest.</li>\n<li>Peak recreational harvest occurs from May through October with over 70 percent of the catch in July and August.</li>\n<li>Gear types, habitat impacts, and bycatch:\n<ul>\n<li>Recreational fishermen use hook-and-line gear that has minimal impacts on habitat.</li>\n<li>Commercial fishermen use a variety of gears including trawls, gillnets, haul seines, and pound nets, and the impacts vary by gear type.</li>\n<li>Gillnets can occasionally entangle marine mammals. However, the bluefish fishery uses nets with small mesh and sinking gillnets to reduce bycatch.</li>\n</ul>\n</li>\n</ul>\n', 'Harvest Type': 'Wild', 'Health Benefits': '<p>Bluefish are a good source of selenium, niacin, vitamin B12, magnesium, and potassium. As apex predators, bluefish can accumulate comparatively high levels of mercury and PCB contaminants. Limited consumption has been recommended in some states.</p>\n', 'Human_Health_': None, 'Human Health': None, 'Physical Description': '<ul>\n<li>Bluefish are blue-green on the back and silvery on the sides and belly.</li>\n<li>They have a prominent jaw, with sharp, compressed teeth.</li>\n</ul>\n', 'Production': None, 'Protein': '20.04 g', 'Quote': 'U.S. wild-caught bluefish is a smart seafood choice because it is sustainably managed and responsibly harvested under U.S. regulations.', 'Quote Background Color': '#89aec3', 'Research': '<ul>\n<li>Several key scientific gaps need to be addressed to better inform management. For example, more research is needed on the relationship between the age and length of bluefish, how much bluefish is caught and discarded in the commercial fisheries for bluefish and other species, the resulting impacts, and general population trends. There is also uncertainty in the methods used by scientists to monitor bluefish abundance and in estimating recreational catch along the Atlantic coast. In 2012, managers established a coast-wide sampling program designed to improve the quantity and quality of information used in future bluefish stock assessments.</li>\n<li>The coast-wide&nbsp;sampling program resulted in a significant increase in the amount of age-length keys and catch-at-age data that was used in the 2015 benchmark assessment.</li>\n<li>The bluefish management plan allows managers to set aside a small percentage of the annual catch limit for research. Proceeds from the sale of this set-aside catch are used to fund research on the bluefish resource and fishery.</li>\n</ul>\n', 'Saturated Fatty Acids, Total': '0.915 g', 'Selenium': '36.5 mcg', 'Serving Weight': '100 g', 'Servings': '1', 'Sodium': '60 mcg', 'Source': '<p>U.S. wild-caught from Massachusetts to Florida.</p>\n', 'Sugars, Total': '0 g', 'Taste': '<p>Rich, full flavor. The larger the fish, the more pronounced the taste. A strong-flavored, dark strip of meat on the fillet may be removed before cooking.</p>\n', 'Texture': '<p>Coarse, moist meat with edible skin.</p>\n', 'Path': '/profiles/bluefish', 'last_update': '10/05/2022 - 14:57'}]
    received_text = getInformSelectSpecies("Bluefish")
