def test_integrationSpecificSpecies2():
    right_text = [{'Fishery Management': '<ul>\n<li><a href="https://www.fisheries.noaa.gov/region/southeast">NOAA Fisheries</a> and the <a href="http://www.safmc.net/">South Atlantic</a> and <a href="http://www.gulfcouncil.org/">Gulf of Mexico</a> Fishery Management Councils manage the red grouper fishery:</li>\n<li>In the South Atlantic, managed under the <a href="https://www.fisheries.noaa.gov/management-plan/south-atlantic-snapper-grouper-fishery-management-plan">Snapper-Grouper Fishery Management Plan</a>:\n<ul>\n<li>Commercial fishermen must have a permit to fish, land, or sell red grouper. Managers limit the number of available permits to control the number of fishermen harvesting red grouper.</li>\n<li>Annual catch limits are used for red grouper in the commercial and recreational fisheries. These fisheries are closed when their annual catch limit is projected to be met.</li>\n<li>Both the commercial and recreational fisheries have size limits to reduce harvest of immature red grouper.</li>\n<li>The commercial and recreational fishing seasons are closed from January through April to protect red grouper during their peak spawning period.</li>\n<li>Gear restrictions are used to reduce bycatch and protect habitat.</li>\n<li>There are eight deep-water marine protected areas and several spawning special management zones to protect habitats. The <a href="http://www.safmc.net/managed-areas/oculina-bank">Oculina Experimental Closed Area</a> is closed to fishing for and possession of all snappers and groupers to protect deepwater coral habitat and the reef fish it supports.</li>\n</ul>\n</li>\n<li>In the Gulf of Mexico, managed under the <a href="https://www.fisheries.noaa.gov/management-plan/gulf-mexico-reef-fish-fishery-management-plan">Reef Fish Fishery Management Plan</a>:\n<ul>\n<li>Commercial vessels must have a reef fish permit and individual fishing quota (IFQ) to harvest red grouper.</li>\n<li>The annual catch limit is allocated between the commercial (76 percent) and recreational (24 percent) fisheries.</li>\n<li>The IFQ program (<a href="https://www.fisheries.noaa.gov/national/laws-and-policies/catch-shares">catch shares</a>) allocates the commercial catch limit among shareholders with measures to prevent fishermen from harvesting more than their individual allocation.</li>\n<li>To reduce bycatch, there are restrictions on the type of gear fishermen may use and where they can fish.</li>\n<li>Minimum size limits protect immature red grouper.</li>\n<li>Year-round and/or seasonal area closures for commercial and recreational sectors to protect spawning groupers.&nbsp;</li>\n<li>Commercial data reporting requirements.</li>\n</ul>\n</li>\n<li>In the U.S. Caribbean:\n<ul>\n<li>Annual catch limits.</li>\n<li>Seasonal closure from February 1 through April 30.</li>\n</ul>\n</li>\n</ul>\n', 'Habitat': '<ul>\n<li>Red grouper are referred to as shallow-water grouper because they’re common in waters 10 to 60 feet deep.</li>\n<li>Juveniles prefer grass beds, rock formations, and reefs in shallow, nearshore waters. They move offshore as they mature.</li>\n<li>Adults are most commonly found around ledges, crevices, and caverns of rocky limestone reefs, and also near lower-profile, live-bottom (sponges, corals and sea squirts) areas.</li>\n<li>Adults may school or move together as groups, but only for short distances.</li>\n<li>Red grouper play a significant role in their underwater environment by acting as “marine engineers.” They&nbsp;excavate flat-bottom areas creating habitat for themselves and other commercially important species, such as <a href="https://www.fishwatch.gov/profiles/caribbean-spiny-lobster">spiny lobster</a>, <a href="https://www.fishwatch.gov/profiles/black-grouper">black grouper</a>, red porgy, and <a href="https://www.fishwatch.gov/profiles/vermilion-snapper">vermilion snapper</a>.</li>\n</ul>\n', 'Habitat Impacts': 'Fishing gear used to catch red grouper rarely contacts the ocean bottom and has minimal impacts on habitat.', 'Image Gallery': [{'src': 'https://origin-east-01-drupal-fishwatch.woc.noaa.gov/sites/default/files/red-grouper_2.jpg', 'alt': 'Red grouper have large mouths, which allow them to eat their prey whole image.', 'title': 'Red grouper have large mouths, which allow them to eat their prey whole.'}, {'src': 'https://origin-east-01-drupal-fishwatch.woc.noaa.gov/sites/default/files/red-grouper_3.jpg', 'alt': 'Red grouper image.', 'title': 'Red grouper.'}, {'src': 'https://origin-east-01-drupal-fishwatch.woc.noaa.gov/sites/default/files/red-grouper_4.jpg', 'alt': 'Red grouper swims through its reef habitat image.', 'title': 'Red grouper swims through its reef habitat.'}, {'src': 'https://origin-east-01-drupal-fishwatch.woc.noaa.gov/sites/default/files/red-grouper_5.jpg', 'alt': 'Red grouper spawning image.', 'title': 'Red grouper spawning.'}, {'src': 'https://origin-east-01-drupal-fishwatch.woc.noaa.gov/sites/default/files/red-grouper_1.jpg', 'alt': 'Red grouper image.', 'title': ''}], 'Location': '<ul>\n<li>Red grouper are found in the western Atlantic Ocean from Massachusetts through the Gulf of Mexico and south to Brazil.&nbsp;</li>\n</ul>\n', 'Management': None, 'NOAA Fisheries Region': 'Southeast', 'Population': 'Above target population level in the Gulf of Mexico. Significantly below target population level in the South Atlantic. A rebuilding plan is in place for the South Atlantic stock.', 'Population Status': '<ul>\n<li>\n<p>There are two stocks of red grouper: the Gulf of Mexico stock and the South Atlantic stock. According to the most recent stock assessments:</p>\n<ul>\n<li>\n<p>The Gulf of Mexico stock is not overfished (2019 stock assessment), and is not subject to overfishing based on 2020&nbsp;catch data.&nbsp; Summary stock assessment information can be found on <a href="https://www.st.nmfs.noaa.gov/stocksmart?app=browse_by_stock&amp;stockid=10331">Stock SMART</a>.</p>\n</li>\n<li>\n<p>The South Atlantic stock is overfished (2017 stock assessment), but is not subject to overfishing based on 2020&nbsp;catch data.&nbsp; Summary stock assessment information can be found on <a href="https://www.st.nmfs.noaa.gov/stocksmart?app=browse_by_stock&amp;stockid=10332">Stock SMART</a>. A rebuilding plan has been in place since 2012.</p>\n</li>\n</ul>\n</li>\n</ul>\n', 'Scientific Name': 'Epinephelus morio', 'Species Aliases': '<a href="/species-aliases/grouper" typeof="skos:Concept" property="rdfs:label skos:prefLabel" datatype="">Grouper</a>, <a href="/species-aliases/cherna-americana" typeof="skos:Concept" property="rdfs:label skos:prefLabel" datatype="">Cherna americana</a>, <a href="/species-aliases/negre" typeof="skos:Concept" property="rdfs:label skos:prefLabel" datatype="">Negre</a>', 'Species Illustration Photo': {'src': 'https://origin-east-01-drupal-fishwatch.woc.noaa.gov/sites/default/files/red_grouper.png', 'alt': 'Red Grouper', 'title': 'Red Grouper'}, 'Species Name': 'Red Grouper', 'Animal Health': None, 'Availability': '<p>Year-round.</p>\n', 'Biology': '<ul>\n<li>Red grouper grow slowly, up to almost 50 inches long and more than 50 pounds.</li>\n<li>The oldest recorded red grouper in the South Atlantic was 26 years old and the oldest recorded in the Gulf of Mexico was 29 years old.</li>\n<li>They are protogynous hermaphrodites – they begin life as females and sexually mature when they reach 4 to 6 years of age. Some later transform into males, most often between the ages of 7 and 15. The proportion of males in the population increases with age.</li>\n<li>They spawn frequently, close to 26 times a year, in shallow waters from February through June.</li>\n<li>Red grouper feed on a wide variety of fish, octopus, and crustaceans, including shrimp, lobsters, and mantis shrimp.</li>\n<li>They are among the top predators in reef community food webs and may control some aspects of community balance in reef systems. Red grouper are unspecialized and opportunistic feeders – they eat any convenient prey. They engulf prey whole by opening their large mouths, dilating their gill covers, rapidly drawing in a current of water, and inhaling the food.</li>\n<li>Smaller grouper are preyed on by the same predators that eat snappers, including jacks, other groupers, sharks, barracudas, and morays. Large sharks and carnivorous marine mammals prey on adult red grouper.</li>\n</ul>\n', 'Bycatch': 'Regulations are in place to minimize bycatch.', 'Calories': '92', 'Carbohydrate': '0 g', 'Cholesterol': '37 mg', 'Color': '<p>Raw and cooked meat is white.</p>\n', 'Disease Treatment and Prevention': None, 'Diseases in Salmon': None, 'Displayed Seafood Profile Illustration': None, 'Ecosystem Services': None, 'Environmental Considerations': None, 'Environmental Effects': None, 'Farming Methods': None, 'Farming Methods_': None, 'Fat, Total': '1.02 g', 'Feeds_': None, 'Feeds': None, 'Fiber, Total Dietary': '0 g', 'Fishing Rate': 'At recommended levels in the Gulf of Mexico and the South Atlantic.', 'Harvest': '<ul>\n<li>Commercial fishery:&nbsp;\n<ul>\n<li>In 2020, commercial landings of red grouper totaled 2.8 million pounds and were valued at approximately $12 million, according to the NOAA Fisheries <a href="https://foss.nmfs.noaa.gov/apexfoss/f?p=215:200:14440981298202::NO:::">commercial fishing landings database</a>.&nbsp;</li>\n</ul>\n</li>\n<li>Gear types, habitat impacts, and bycatch:\n<ul>\n<li>Commercial fishermen mainly use hook-and-line gear, including longlines and handlines, to harvest red grouper.&nbsp;</li>\n<li>Trawl gear, fish traps, and bottom longlines are prohibited in some areas to reduce bycatch. Several areas are closed to all fishing to protect snappers and groupers, including red grouper.</li>\n<li>Sea turtles and other reef fishes, such as snappers and groupers, can be incidentally caught while fishing for red grouper.&nbsp;</li>\n<li>In certain areas, fishermen are required to use circle hooks to improve the chance of survival of any unintentionally caught fish and to reduce turtle hookings.&nbsp;</li>\n<li>Commercial and charterboat/headboat reef fish fishermen must use appropriate release gear and follow handling protocols to increase the chance of survival for any incidentally caught <a href="http://sero.nmfs.noaa.gov/sustainable_fisheries/gulf_sa/turtle_sawfish_release/index.html">sea turtles</a>.&nbsp;</li>\n<li>Fishermen are encouraged to use <a href="https://www.flseagrant.org/fisheries/venting/" rel="external">venting tools</a>&nbsp;or <a href="https://returnemright.org/barotrauma/" rel="external">fish descenders</a>&nbsp;when fish are caught showing signs of barotrauma. Barotrauma occurs when reef fish are quickly brought to the surface by hook-and-line and the gas in their swimbladders expands. <a href="https://www.flseagrant.org/fisheries/venting/" rel="external">Venting tools</a>&nbsp;help deflate the expanded abdominal cavity, potentially reduce injury to the fish, and make it easier to return to deep water.</li>\n</ul>\n</li>\n<li>Recreational fishery:\n<ul>\n<li>Red grouper is a popular fish among recreational fishermen in the South Atlantic and Gulf of Mexico.</li>\n<li>In 2020, recreational anglers landed 2.9 million pounds of red grouper, according to the NOAA Fisheries <a href="https://foss.nmfs.noaa.gov/apexfoss/f?p=215:200:14440981298202::NO:::">recreational fishing landings database</a>.&nbsp;&nbsp;</li>\n<li>In the South Atlantic:\n<ul>\n<li>Annual catch limits&nbsp;and accountability measures.</li>\n<li>Bag and size limits.</li>\n<li>The fishery is closed during the spawning season (from January through April).</li>\n</ul>\n</li>\n<li>In the Gulf of Mexico:\n<ul>\n<li>Annual catch limits&nbsp;and accountability measures.</li>\n<li>Bag and size limits.</li>\n<li>The fishery is closed during the spawning season (from February 1 through March 31) in deep water to protect spawning aggregations.</li>\n</ul>\n</li>\n<li>In the U.S. Caribbean:\n<ul>\n<li>Annual catch limits.</li>\n<li>Seasonal closure from February 1 through April 30.</li>\n<li>Bag and vessel limits.</li>\n</ul>\n</li>\n</ul>\n</li>\n</ul>\n', 'Harvest Type': 'Wild', 'Health Benefits': '<p>Red grouper is low in saturated fat, and a good source of vitamins B6 and B12, phosphorus, potassium, protein, and selenium.</p>\n', 'Human_Health_': None, 'Human Health': None, 'Physical Description': '<ul>\n<li>Red grouper have robust bodies with small scales.</li>\n<li>Their head and body are dark reddish brown, shading pink or reddish below with occasional white spots on the sides and black spots on the cheeks.</li>\n<li>They have large mouths with a lower jaw that often projects slightly beyond their upper jaw, with bands of slender, sharp teeth, and usually a few stout, fixed canines.</li>\n<li>Their large mouths allow them to eat their prey whole.&nbsp;</li>\n</ul>\n', 'Production': None, 'Protein': '19.38 g', 'Quote': 'Although some populations are below target levels, U.S. wild-caught red grouper is still a smart seafood choice because it is sustainably managed and responsibly harvested under U.S. regulations.  ', 'Quote Background Color': '#5f231e', 'Research': '<ul>\n<li><a href="https://www.sefsc.noaa.gov/species/fish/reeffish.htm">NOAA Southeast Fisheries Science Center Reef Fish Research</a></li>\n</ul>\n', 'Saturated Fatty Acids, Total': '0.233 g', 'Selenium': '36.5 mcg', 'Serving Weight': '100 g', 'Servings': '1', 'Sodium': '53 mg', 'Source': '<p>U.S. wild-caught from Massachusetts to the Gulf of Mexico.</p>\n', 'Sugars, Total': '0 g', 'Taste': '<p>Red grouper has a mild but distinct flavor, somewhere between bass and halibut. Red grouper is sweeter and milder than black grouper, and many consider red grouper the tastier of the two.</p>\n', 'Texture': '<p>Very firm, moist, and flaky.</p>\n', 'Path': '/profiles/red-grouper', 'last_update': '10/05/2022 - 16:17'}]
    received_text = getInformSelectSpecies("Red Grouper")
    assert right_text == received_text
